import React, { useContext } from "react";

function User(props) {
  const user = useContext(props.userContext);
  {
    user ? (
      <div>
        <button>Sign Up</button>
      </div>
    ) : (
      <div>
        <button></button>
      </div>
    );
  }
}

export default User;
